body:
for easier upvoting:
1. Open up console in your browser(google how to do it based on your own browser)
2. type in:

let upvotes = document.getElementsByClassName("arrow-up");

for(let i = 0;i < upvotes.length;i++){
    upvotes[i].click();
};


this little macro presses all upvote arrows that are seen in page.
